import React from 'react';
import './brand.css';
import {react, mysql, express, node} from './imports';

const Brand = () => {
  return (
    <div className='gpt3__brand'>
      <div className='gpt3__brand-heading'>
        <h1 className='gradient__text'>Technical Skills</h1>
      </div>
      <div className='gpt3__brand-images'>
          <div><img src={react} alt='react' /></div>
          <div><img src={mysql} alt='slack' /></div>
          <div><img src={express} alt='atlassian' /></div>
          <div><img src={node} alt='dropbox' /></div>
      </div>
    </div>
  )
}

export default Brand
